function sortMessagesByTimestamp(messages) {
  if (messages.length <= 1) {
    return messages;
  }
  return messages.sort((a, b) => {
    if (a.timestamp !== b.timestamp) {
      return a.timestamp - b.timestamp;
    }
    return a.id.localeCompare(b.id);
  });
}

